import { useEffect, useState } from "react";
import React from "react";

export default function ExchangeData() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch data on component mount
  useEffect(() => {
    fetch("http://localhost:5000/api/exchange") // Adjust URL if necessary
      .then((res) => {
        if (!res.ok) {
          throw new Error(`HTTP error! status: ${res.status}`);
        }
        return res.json();
      })
      .then((response) => {
        console.log("Raw API Response:", response); // Debug: Log raw response
        const extractedData =
          response?.hits?.hits?.map((item) => ({
            id: item._id, // Add _id
            ...item._source,
          })) || [];
        console.log("Extracted Data:", extractedData); // Debug: Log extracted data
        setData(extractedData);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Error fetching data:", err);
        setError(err.message);
        setLoading(false);
      });
  }, []);

  // Handle loading state
  if (loading) {
    return <p className="text-center text-gray-500">Loading...</p>;
  }

  // Handle error state
  if (error) {
    return (
      <p className="text-center text-red-500">
        Error: {error}. Please check your API.
      </p>
    );
  }

  // Handle empty data
  if (data.length === 0) {
    return <p className="text-center text-gray-500">No data available.</p>;
  }

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <h1 className="text-3xl font-bold text-blue-600 mb-6">Exchange Data</h1>

      {/* Table */}
      <div className="overflow-x-auto">
        <table className="table-auto w-full bg-white shadow-md rounded-lg">
          <thead>
            <tr className="bg-blue-500 text-black">
              <th className="px-4 py-2">ID</th>
              <th className="px-4 py-2">Symbol</th>
              <th className="px-4 py-2">Name</th>
              <th className="px-4 py-2">Type</th>
              <th className="px-4 py-2">Currency</th>
              <th className="px-4 py-2">Country</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item, index) => (
              <tr key={index} className="border-b hover:bg-gray-100">
                <td className="px-4 py-2">{item.id || "N/A"}</td>
                <td className="px-4 py-2">{item.symbol || "N/A"}</td>
                <td className="px-4 py-2">{item.name || "N/A"}</td>
                <td className="px-4 py-2">{item.type || "N/A"}</td>
                <td className="px-4 py-2">{item.currency || "N/A"}</td>
                <td className="px-4 py-2">{item.country || "N/A"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
